def pivot_table(
    data,
    values=None,
    index=None,
    columns=None,
    aggfunc="mean",
    fill_value=None,
    margins=False,
    dropna=True,
    margins_name="All",
    observed=False,
) -> "DataFrame":
    index = _convert_by(index)
    columns = _convert_by(columns)

    if isinstance(aggfunc, list):
        pieces: List[DataFrame] = []
        keys = []

        for func in aggfunc:
            grouped = data.groupby(index + columns, observed=observed)
            agged = grouped.agg(func)
            if dropna and isinstance(agged, ABCDataFrame) and len(agged.columns):
                agged = agged.dropna(how="all")
                for v in values:
                    if (
                        v in data
                        and is_integer_dtype(data[v])
                        and v in agged
                        and not is_integer_dtype(agged[v])
                    ):
                        agged[v] = maybe_downcast_to_dtype(agged[v], data[v].dtype)

            pieces.append(agged)
            keys.append(getattr(func, "__name__", func))

        result = concat(pieces, keys=keys, axis=1)

    else:
        grouped = data.groupby(index + columns, observed=observed)
        agged = grouped.agg(aggfunc)
        if dropna and isinstance(agged, ABCDataFrame) and len(agged.columns):
            agged = agged.dropna(how="all")
            for v in values:
                if (
                    v in data
                    and is_integer_dtype(data[v])
                    and v in agged
                    and not is_integer_dtype(agged[v])
                ):
                    agged[v] = maybe_downcast_to_dtype(agged[v], data[v].dtype)
        result = agged

    if result.index.nlevels > 1:
        # Related GH #17123
        # If index_names are integers, determine whether the integers refer
        # to the level position or name.
        index_names = result.index.names[: len(index)]
        to_unstack = []
        for i in range(len(index), len(index + columns)):
            name = result.index.names[i]
            if name is None or name in index_names:
                to_unstack.append(i)
            else:
                to_unstack.append(name)
        result = result.unstack(to_unstack)

    if not dropna:
        if result.index.nlevels > 1:
            m = MultiIndex.from_arrays(
                cartesian_product(result.index.levels), names=result.index.names
            )
            result = result.reindex(m, axis=0)

        if result.columns.nlevels > 1:
            m = MultiIndex.from_arrays(
                cartesian_product(result.columns.levels), names=result.columns.names
            )
            result = result.reindex(m, axis=1)

    if isinstance(result, ABCDataFrame):
        result = result.sort_index(axis=1)

    if fill_value is not None:
        result = result._ensure_type(result.fillna(fill_value, downcast="infer"))

    if margins:
        if dropna:
            data = data[data.notna().all(axis=1)]
        result = _add_margins(
            result,
            data,
            values,
            rows=index,
            cols=columns,
            aggfunc=aggfunc,
            observed=dropna,
            margins_name=margins_name,
            fill_value=fill_value,
        )

    return result
